// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import Quiz from './components/Quiz';
import QuizResults from './components/QuizResults';
import Quizzes from './components/Quizzes';
import Result from './components/Result';

// Import the global style
import './style.css';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard username="User" />} />
        <Route path="/quiz/:quizId" element={<Quiz quiz={{
          id: 1,
          title: 'Sample Quiz',
          questions: [
            ["What is phishing?", ["Scam", "Fishing", "Cooking"], "Scam"],
            // Add additional questions here
          ]
        }} />} />
        <Route path="/quiz_results/:quizId" element={<QuizResults score={2} total={3} results={[]} />} />
        <Route path="/quizzes" element={<Quizzes quizzes={{1: 'Email Phishing', 2: 'Website Spoofing'}} />} />
        <Route path="/result" element={<Result score={2} total={3} resultText="passed" />} />
      </Routes>
    </Router>
  );
};

export default App;
